export const incrementer=()=>{
    return {type:"incrementer"}
}
export const decrementer=()=>{
    return {type:"decrementer"}
}
export const resert=()=>{
    return {type:"reset"}
}
export const incrementerbynumber=(value)=>{
    return {type:"incrementerbynumber",payload:value}
}
